const About = () => {
  return (
    <>
      <h1>About The Product</h1>
      <p>
        Hea Pro is a user-friendly, intuitive tool that allows you to
        input your symptoms, providing a detailed overview of possible
        underlying causes. Whether you're experiencing headaches, fatigue,
        stomach pain, or any other discomfort, SymptomChecker Pro analyzes your
        symptoms and presents you with a range of potential conditions or
        illnesses associated with those symptoms. It's important to note that
        **SymptomChecker  serves as a helpful guide and should not replace
        professional medical advice. While the tool provides you with possible
        causes, it is essential to consult with your doctor or healthcare
        provider for a conclusive diagnosis. The guidance provided by
        SymptomChecker Pro is meant to support your conversations with medical
        professionals, ensuring that you can provide them with comprehensive
        information about your symptoms.
      </p>
    </>
  );
};

export default About;
